sec.p:
We then enter the life of a bank executive Pratyush Shelar (
Atul Kulkarni
). He gets home late on his anniversary because he had to console an old college classmate about her marital woes. His own marital woes are worsened when his wife Antara ( Suchitra Pillai) kicks up a big fight and leaves their home with their daughter Saanjh.

Pratyush is upset about this. His colleague Aslam Durrani ( Harsh Khurana) picks up on this and suggests an exotic dancer Teesta (
Shweta Menon
). Pratyush is too upset to be interested. But Aslam is determined; later that night he calls Pratyush and pretends as though some thugs are about to kill him; and he asks Pratyush to come immediately to a certain location.

when the cops begin to investigate, they find that Teesta had a roommate Sonali Jasmine, and that Sonali is engaged to a prominent businessman, K.K. Menon ( Sanjay Singh). The investigating officer, and the hero of this movie, is Inspector Arvind Khanvilkar (
Rahul Dev
). The prime suspect is an unwitting Pratyush because he was the last person to see Teesta alive.
